import React from "react";
import ReactDOM from "react-dom";

function ping() {
    fetch('../api')
      .then(response => response.json())
      .then(data => this.setState({ data }));
}

ReactDOM.render(
    <div>
        <div>This page was served statically</ div>
        {ping()}
    </div>,
    document.getElementById('root')
);
